import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./Component/Home/Home";
import "./App.css";

function App() {
  return (
    <>
      <Router>
        <nav>
          <ul>
            <li>
              <Link to="home">home</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" index></Route>
          <Route path="home" element={<Home />}></Route>
        </Routes>
      </Router>
    </>
  );
}

export default App;
